    <h2 class="header">Page Source</h2>
    <pre><textarea class="page-source" readonly>content: &#34;**项目描述：** --一个外形为树枝的二级[[[*https://wiki.pigeon-games.com/index.php?title=Protected:%E5%BC%82%E6%83%B3%E4%B9%8B%E7%89%A9 | 异想之物]]]，是制造N██████ ████████om的魔杖的原材料，曾造成[[[https://toaru.huijiwiki.com/wiki/%D1%A7%D4%B0%B6%BC%CA%D0%B5%DA%B6%FE%CA%AE%D2%BB%D1%A7%C7%F8 | 学园都市第二十一学区]]]的宝可梦极巨化，导致命令方块不能正常运行。--\n一段树枝，长约9英寸，带有认知危害，靠近它1英尺内的人的世界观会非常错乱，分不清虚拟与现实，严重影响工作。\n**回收日期：**--羊历3533/██/██-- 2023/██/██\n**回收地点：**--[[[https://antimony.fandom.com/zh/wiki/%E9%94%91%E6%98%9F | 锑星]]]西牛贺洲[[[https://thwiki.cc/%E5%B9%BB%E6%83%B3%E4%B9%A1|幻想乡]]]-- ██省██县██镇\n**当前状态：**--再起不能-- 存放在Site-CN-██的低价值物品储藏柜。\n**笔记：**//串台了。//  ——Dr. C████\n//成分复杂……//  ——研究员███&#34;</textarea></pre>
